import "./Home.css";
import TopRightMenu from "../Top Right Menu/TopRightMenu";
import FirstPage from "../First Page/FirstPage";
import LastPage from "../Last Page/LastPage";
import TopLeftMenu from "../Top Left Menu/TopLeftMenu";

function Home() {
  return (
      <>
      <section style={{backgroundColor: "#ECE0DB"}}>
        <FirstPage />
      </section>
      <section style={{padding:"2.5rem"}}>
        <TopRightMenu />
      </section>
      <section style={{padding:"2.5rem"}}>
        <TopLeftMenu />
      </section>
      <section style={{backgroundColor: "#ECE0DB", marginTop:"70px"}}>
        <LastPage />
      </section>
      </>
  );
}

export default Home;
